import React, { useEffect, useState } from 'react';
import { MapContainer, TileLayer, Marker, Popup } from 'react-leaflet';
import 'leaflet/dist/leaflet.css';
import axios from 'axios';
import L from 'leaflet';
import { Box } from '@mui/material';

// Fix for default marker icons in Leaflet with React
delete (L.Icon.Default.prototype as any)._getIconUrl;
L.Icon.Default.mergeOptions({
    iconRetinaUrl: 'https://cdnjs.cloudflare.com/ajax/libs/leaflet/1.7.1/images/marker-icon-2x.png',
    iconUrl: 'https://cdnjs.cloudflare.com/ajax/libs/leaflet/1.7.1/images/marker-icon.png',
    shadowUrl: 'https://cdnjs.cloudflare.com/ajax/libs/leaflet/1.7.1/images/marker-shadow.png',
});

interface TransportMetric {
  line_id: string;
  line_name: string;
  status: string;
  delay_minutes: number;
  reliability_percentage: number;
  disruptions: number;
  congestion_level: number;
  timestamp: string;
}

// Dummy schedule data for bus locations
const dummySchedule = [
  { line_id: 'bakerloo', lat: 51.5320, lng: -0.1053, nextStop: 'Paddington', arrivalTime: '10:05' },
  { line_id: 'central', lat: 51.5154, lng: -0.1755, nextStop: 'Oxford Circus', arrivalTime: '10:10' },
  { line_id: 'circle', lat: 51.5120, lng: -0.1032, nextStop: 'King\'s Cross', arrivalTime: '10:15' },
  { line_id: 'district', lat: 51.5074, lng: -0.1278, nextStop: 'Victoria', arrivalTime: '10:20' },
  { line_id: 'hammersmith-city', lat: 51.5194, lng: -0.1770, nextStop: 'Hammersmith', arrivalTime: '10:25' },
  { line_id: 'jubilee', lat: 51.5033, lng: -0.1145, nextStop: 'Waterloo', arrivalTime: '10:30' },
  { line_id: 'metropolitan', lat: 51.5206, lng: -0.1050, nextStop: 'Baker Street', arrivalTime: '10:35' },
  { line_id: 'northern', lat: 51.5074, lng: -0.1278, nextStop: 'Camden Town', arrivalTime: '10:40' },
  { line_id: 'piccadilly', lat: 51.5098, lng: -0.1337, nextStop: 'Piccadilly Circus', arrivalTime: '10:45' },
  { line_id: 'victoria', lat: 51.4965, lng: -0.1447, nextStop: 'Green Park', arrivalTime: '10:50' },
  { line_id: 'waterloo-city', lat: 51.5033, lng: -0.1145, nextStop: 'Bank', arrivalTime: '10:55' }
];

const Map: React.FC = () => {
  const [metrics, setMetrics] = useState<TransportMetric[]>([]);
  const [busLocations, setBusLocations] = useState(dummySchedule);
  const [center] = useState<[number, number]>([51.505, -0.09]); // London coordinates

  useEffect(() => {
    const fetchMetrics = async () => {
      try {
        const response = await axios.get('/metrics.json');
        const data = response.data;
        const metricsArray = Object.values(data) as TransportMetric[];
        setMetrics(metricsArray);
      } catch (error) {
        console.error('Error fetching metrics:', error);
      }
    };

    fetchMetrics();
    const interval = setInterval(fetchMetrics, 30000); // Update every 30 seconds

    return () => clearInterval(interval);
  }, []);

  // Simulate real-time bus location updates
  useEffect(() => {
    const updateBusLocations = () => {
      setBusLocations(prevLocations => 
        prevLocations.map(bus => ({
          ...bus,
          lat: bus.lat + (Math.random() * 0.001 - 0.0005),
          lng: bus.lng + (Math.random() * 0.001 - 0.0005)
        }))
      );
    };

    const busInterval = setInterval(updateBusLocations, 5000); // Update every 5 seconds
    return () => clearInterval(busInterval);
  }, []);

  return (
    <Box sx={{ height: '500px', width: '100%', position: 'relative' }}>
      <MapContainer
        center={center}
        zoom={11}
        style={{ height: '100%', width: '100%', position: 'absolute', top: 0, left: 0 }}
      >
        <TileLayer
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
        />
        {busLocations.map((bus) => (
          <Marker
            key={bus.line_id}
            position={[bus.lat, bus.lng]}
          >
            <Popup>
              <div>
                <strong>Line:</strong> {bus.line_id}<br />
                <strong>Next Stop:</strong> {bus.nextStop}<br />
                <strong>Arrival Time:</strong> {bus.arrivalTime}
              </div>
            </Popup>
          </Marker>
        ))}
      </MapContainer>
    </Box>
  );
};

export default Map;
